import React from "react";
import "./shopMenu.css";

const ShopMenu = () => {
  return (
    <div className="shop-menu">
      <ul className="menu-drop__list">
        <li className="menu-drop__item"></li>
      </ul>
    </div>
  );
};

export default ShopMenu;
